	vmovapd ymm10, ymmword ptr [nodes + (291)*SIZEOF_NODE + OFFSETOF_SPIN]  ; load s_8_9_6 (neighbor)
	_vdotp xmm10, ymm6, ymm10, xmm11, ymm11  ; (ymm6, ymm10)
	vmulsd xmm15, xmm9, xmm10
	; edge: 9_8_6 -> 9_9_6
	vmovapd ymm10, ymmword ptr [nodes + (327)*SIZEOF_NODE + OFFSETOF_SPIN]  ; load s_9_8_6 (neighbor)
	_vdotp xmm10, ymm6, ymm10, xmm11, ymm11  ; (ymm6, ymm10)
	vfmadd213sd xmm15, xmm9, xmm10  ; xmm15 += xmm9 * xmm10
	; edge: 9_9_5 -> 9_9_6
	vmovapd ymm10, ymmword ptr [nodes + (330)*SIZEOF_NODE + OFFSETOF_SPIN]  ; load s_9_9_5 (neighbor)
	_vdotp xmm10, ymm6, ymm10, xmm11, ymm11  ; (ymm6, ymm10)
	vfmadd213sd xmm15, xmm9, xmm10  ; xmm15 += xmm9 * xmm10
	; edge: 9_9_6 -> 10_9_6
	vmovapd ymm10, ymmword ptr [nodes + (411)*SIZEOF_NODE + OFFSETOF_SPIN]  ; load s_10_9_6 (neighbor)
	_vdotp xmm10, ymm6, ymm10, xmm11, ymm11  ; (ymm6, ymm10)
	vfmadd213sd xmm15, xmm9, xmm10  ; xmm15 += xmm9 * xmm10

	ret
deltaU_9_9_6 ENDP

; Runs the standard metropolis algorithm
; @param RCX (uint64) - number of iterations
; @return (void)
PUBLIC metropolis
metropolis PROC
	; *rax - scratch reg.; *rax - scratch reg.
	;  rcx - loop counter
	;  rdx - index[3]
	;  rbx - constant (double) 2^-53
	;  rsp - 
	;  rbp - 
	;  rsi - index[0]
	;  rdi - MUTABLE_NODE_COUNT
	;  r8  - index[1]
	;  r9  - index[2]
	;  r10 - p[0]
	;  r11 - p[1]
	;  r12 - p[2]
	;  r13 - p[3]
	;  r14 - 
	;  r15 - 
	;  ymm0  - new spin, s'
	;  ymm1  - new flux, f'
	;  ...
	;  ymm12 - vectorized PNRG state[0]
	;  ymm13 - vectorized PRNG state[1]
	;  ymm14 - vectorized PRNG state[2]
	;  ymm15 - vectorized PRNG state[3]
	; load vectorized PRNG (xoshiro256**) state into YMM12, YMM13, YMM14, YMM15
	vmovdqa ymm12, ymmword ptr [prng_state + (0)*32]
	vmovdqa ymm13, ymmword ptr [prng_state + (1)*32]
	vmovdqa ymm14, ymmword ptr [prng_state + (2)*32]
	vmovdqa ymm15, ymmword ptr [prng_state + (3)*32]
	mov rdi, MUTABLE_NODE_COUNT ; load mutable nodes array size
	mov rbx, 3CB0000000000000h  ; load constant (double) 2^-53
	cmp rcx, 0
	LOOP_START:
		jz LOOP_END

		; select 4 random indices for mutable nodes (rsi, r8, r9, rdx)
		_vxoshiro256ss ymm0, ymm12, ymm13, ymm14, ymm15, ymm11  ; [a, b, c, d]
		vmovq rax, xmm0     ; extract a
		mul rdi             ; rdx:rax = rax * rdi = random * NODE_COUNT
		mov rsi, rdx        ; save 1st future random index (rsi)
		_vpermj xmm0, xmm0  ; [b, a, c, d]
		vmovq rax, xmm0     ; extract b
		mul rdi
		mov r8, rdx         ; save 2nd future random index (r8)
		_vpermk ymm0, ymm0  ; [c, d, b, a]
		vmovq rax, xmm0     ; extract c
		mul rdi
		mov r9, rdx         ; save 3rd future random index (r9)
		_vpermj xmm0, xmm0  ; [d, c, b, a]
		vmovq rax, xmm0     ; extract d
		mul rdi             ; save 4th future random index (rdx)

		; generate 4 \omega \in [0, 1) for probabilistic branching (r10, r11, r12, r13)
		xor r10, r10  ; TODO: (stub) p[0]=0
		xor r11, r11  ; TODO: (stub) p[1]=0
		xor r12, r12  ; TODO: (stub) p[2]=0
		xor r13, r13  ; TODO: (stub) p[3]=0

		; pick uniformally random new state for the node
		_vputj xmm0, rax  ; TODO: (stub) new spin, s'=-J
		_vneg ymm0, ymm0, ymm1
		_vput0 ymm1  ; TODO: (stub) new flux, f'=0

		; compute -deltaU for the proposed state change
		lea rax, deltaU         ; pointer to array of function pointers
		mov rax, [rax + rsi*8]  ; deltaU[rsi], dereferenced to get the actual function pointer
		_dumpreg
		call rax  ; args: (ymm0, ymm1?) -> return xmm15

		_dumpreg
		; compute probability, p = e^(-deltaU/kT)
		; TODO: (stub)

		; (maybe) change the node's state
		; TODO: (stub)

		dec rcx
		jmp LOOP_START
	LOOP_END:

	; save PRNG state
	vmovdqa ymmword ptr [prng_state + (0)*32], ymm12
	vmovdqa ymmword ptr [prng_state + (1)*32], ymm13
	vmovdqa ymmword ptr [prng_state + (2)*32], ymm14
	vmovdqa ymmword ptr [prng_state + (3)*32], ymm15
	ret
metropolis ENDP

PUBLIC main
main PROC
	; seed PRNG (xoshiro256**)
	rdseed rcx   ; try hardware entropy
	jc TSC_END   ; skip timestamp counter (TSC) method on success
	rdtscp       ; sets edx:eax (TSC) and ecx (processor core). high bits 0ed.
	shl rdx, 32  ; reconstruct 64-bit TSC in rax
	or rax, rdx
	ror rcx, 5   ; rotate small number to highest order bits (CPU cores = 24)
	xor rcx, rax
	TSC_END:     ; initial seed is now in rcx. Now SplitMix64.
	_splitmix64 rax, rcx, rdx
	mov qword ptr [prng_state + (0)*32 + (0)*8], rax
	_splitmix64 rax, rcx, rdx
	mov qword ptr [prng_state + (1)*32 + (0)*8], rax
	_splitmix64 rax, rcx, rdx
	mov qword ptr [prng_state + (2)*32 + (0)*8], rax
	_splitmix64 rax, rcx, rdx
	mov qword ptr [prng_state + (3)*32 + (0)*8], rax
	_splitmix64 rax, rcx, rdx
	mov qword ptr [prng_state + (0)*32 + (1)*8], rax
	_splitmix64 rax, rcx, rdx
	mov qword ptr [prng_state + (1)*32 + (1)*8], rax
	_splitmix64 rax, rcx, rdx
	mov qword ptr [prng_state + (2)*32 + (1)*8], rax
	_splitmix64 rax, rcx, rdx
	mov qword ptr [prng_state + (3)*32 + (1)*8], rax
	_splitmix64 rax, rcx, rdx
	mov qword ptr [prng_state + (0)*32 + (2)*8], rax
	_splitmix64 rax, rcx, rdx
	mov qword ptr [prng_state + (1)*32 + (2)*8], rax
	_splitmix64 rax, rcx, rdx
	mov qword ptr [prng_state + (2)*32 + (2)*8], rax
	_splitmix64 rax, rcx, rdx
	mov qword ptr [prng_state + (3)*32 + (2)*8], rax
	_splitmix64 rax, rcx, rdx
	mov qword ptr [prng_state + (0)*32 + (3)*8], rax
	_splitmix64 rax, rcx, rdx
	mov qword ptr [prng_state + (1)*32 + (3)*8], rax
	_splitmix64 rax, rcx, rdx
	mov qword ptr [prng_state + (2)*32 + (3)*8], rax
	_splitmix64 rax, rcx, rdx
	mov qword ptr [prng_state + (3)*32 + (3)*8], rax

	mov rcx, 1     ; number of iterations
	call metropolis

	xor rax, rax  ; return 0
	ret
main ENDP

